/* eslint-disable max-len */
import { expect } from 'chai';

/*

Alice wrote a sequence of words in CamelCase as a string of letters, , having the following properties:

It is a concatenation of one or more words consisting of English letters.
All letters in the first word are lowercase.
For each of the subsequent words, the first letter is uppercase and rest of the letters are lowercase.
Given , print the number of words in  on a new line.

Input Format

A single line containing string .

Constraints

Output Format

Print the number of words in string .

Sample Input

saveChangesInTheEditor
Sample Output

5
Explanation

String  contains five words:

save
Changes
In
The
Editor
Thus, we print  on a new line
*/

describe('camelCase', () => {

  function calculateWords(input) {
    const letters = input.split('');

    return letters.reduce((previous, next) => {
      if (next.charCodeAt() >= 65 && next.charCodeAt() <= 90) {
        return previous + 1;
      }
      return previous;
    }, 1);

  }

  it('saveChangesInTheEditor => 5', () => {
    const input = 'saveChangesInTheEditor';
    const expected = 5;

    const actual = calculateWords(input);
    expect(actual).equals(expected);
  });

  it('fooBar => 2', () => {
    const input = 'fooBar';
    const expected = 2;

    const actual = calculateWords(input);
    expect(actual).equals(expected);
  });

  it('foo => 1', () => {
    const input = 'foo';
    const expected = 1;

    const actual = calculateWords(input);
    expect(actual).equals(expected);
  });

  it('helloThereMrFooBarIAmAMagicalUnicornOk => 11', () => {
    const input = 'helloThereMrFooBarIAmAMagicalUnicornOk';
    const expected = 11;

    const actual = calculateWords(input);
    expect(actual).equals(expected);
  });

  it('absurdly long string => ', () => {
    const input = '';

    const expected = 1864;

    const actual = calculateWords(input);
    expect(actual).equals(expected);
  });

});
